            function gup(name) {
                var sPageURL = window.location.href.substring(window.location.href.lastIndexOf('?') + 1);
                var sURLVariables = sPageURL.split('&');
                var sParameterName;
                var i;
                for (i = 0; i < sURLVariables.length; i++) {
                    sParameterName = sURLVariables[i].split('=');
                    if (sParameterName[0] === name) {
                        return sParameterName[1] === undefined ? true : sParameterName[1];
                    }
                }
            }

                    $(element).removeAttr('href');
                    $(anchor).attr('href', attrStr);
                });
                $('a.ui-btn').css('width', '97%');
                $('div.ui-body-inherit').css('width', '97.7%');

                    $('#' + gup('sel')).click();

                    }, 500);

                    response.percentile90 = csvData[i][16];
                    response.percentile95 = csvData[i][17];
                    response.percentile99 = undefined;
                    response.thoughput = undefined;
                    response.error = csvData[18][1];
                    json.testcases.push(response);
                }
            }
            generateHeader(json);
        }
        function generateHeader(json) {
            $("#duration").html(json.duration);
            var date = new Date(json.startTime);
            $("#startTime").html('Start Time: ' + date.toLocaleString('en-US'));
            $("#totalUsers").html(json.totalUsers);
            $("#totalHits").html(json.totalHits);
            $("#totalThroughputs").html(json.totalThroughputs);
            $("#averageHits").html(json.averageHits);
            $("#averageThroughputs").html(json.averageThroughputs);
            $("#consumedBandwidth").html(json.consumedBandwidth);
            $("#testcasesPassed").html(json.testcasesPassed);
            if (json.testcasesPassed == 0) {
                $("#testcasesPassed").css("color", "red");
            }
            $("#testcasesFailed").html(json.testcasesFailed);
            $("#testcasesErrorRate").html(json.testcasesErrorRate);
            $("#tps").html(json.tps);
            generateTable(json.testcases);
        }
        function generateTable(json) {
            $('#table').bootstrapTable({
                data: json,
                dataType: json,
                idField: 'id',
                showColumns: true,
                columns: [
                    {
                        field: 'name',
                        title: 'Test Case',
                        sortable: true,
                        align: 'left',
                        class: 'firstColumn'
                    },
                    {
                        field: 'successCount',
                        title: 'Success',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'failureCount',
                        title: 'Failures',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'durationAverage',
                        title: 'Average (msc)',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'totalRequest',
                        title: 'Total Request',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'durationMax',
                        title: 'Max (msc)',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'standardDeviation',
                        title: 'Std Dev',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'percentile90',
                        title: 'Perc. 90%',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'percentile95',
                        title: 'Perc. 95%',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'error',
                        title: 'Error (%)',
                        sortable: true,
                        align: 'left',
                    },
                    {
                        field: 'testcaseTPS',
                        title: 'TPS',
                        sortable: true,
                        align: 'left',
                    },
                ],
                treeShowField: 'name',
                parentIdField: 'pid',
                onPostBody: function () {
                    var columns = $('#table').bootstrapTable('getOptions').columns
                    if (columns && columns[0][1].visible) {
                        $('#table').treegrid({
                            treeColumn: 0,
                            initialState: 'collapsed',
                            onChange: function () {
                                $('#table').bootstrapTable('resetView')
                            }
                        })
                    }
                }
            });
            const btn = document.querySelector('[title="Columns"]');
            btn.addEventListener('click', e => {
                if (btn.classList.contains("show")) {
                    btn.classList.remove("show");
                    btn.childNodes[3].setAttribute("style", "");
                    btn.childNodes[3].classList.remove("show");
                } else {
                    btn.classList.add("show");
                    btn.childNodes[3].classList.add("show");
                    btn.childNodes[3].setAttribute("style", "position: absolute; transform: translate3d(-250px, 38px, 0px); top: 0px; left: 100px; will-change: transform;");
                    btn.childNodes[3].setAttribute("x-placement", "bottom-end");
                }
            });

        }
        function detectFailures() {
            var table = document.getElementById('table');
            for (var i = 0, row; row = table.rows[i]; i++) {
                for (var j = 0, col; col = row.cells[j]; j++) {
                    if (table.rows[i].cells[2] == table.rows[i].cells[j]) {
                        if (table.rows[i].cells[j].innerHTML > 0) {
                            table.rows[i].style.backgroundColor = "#f7aeae;";
                        }
                    }
                }
            }
        }

        function timeArrayToSeconds(array) {
            if (array.length == 1) {
                return (parseInt(array[0])).toFixed(2);
            }
            if (array.length == 2) {
                minutesToSeconds = (parseInt(array[0]) * 60);
                seconds = parseInt(array[1])
                return (minutesToSeconds + seconds).toFixed(2);
            }
            if (array.length == 3) {
                hoursToSeconds = (parseInt(array[0]) * 60) * 60;
                minutesToSeconds = parseInt(array[1]) * 60;
                seconds = parseInt(array[2])
                return (hoursToSeconds + minutesToSeconds + seconds).toFixed(2);
            }
        }
    </script>
</head>
